import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import store from './redux/store';

ReactDOM.render(<App />, document.getElementById('root'));

//监测redux中状态的改变，若redux的状态发生了改变，那么重新
store.subscribe(() => {
	ReactDOM.render(<App />, document.getElementById('root'));
});
